        """Delete records older than specified date"""
        query = text("DELETE FROM transactions WHERE transaction_date < :cutoff")
        with engine.begin() as conn:
            result = conn.execute(query, {"cutoff": cutoff_date})
            logger.info(f"Deleted {result.rowcount} records older than {cutoff_date}")
            return result.rowcount

