class DataValidator:
    def validate_ppop_zip4(self, zip_code: str) -> bool:
        """Validate PPoPZIP+4 matches required format"""
        return bool(re.match(PPOP_ZIP4_PATTERN, zip_code))

    def validate_zero_padded_fields(self, value: str, length: int) -> bool:
        """Validate numeric fields are zero-padded"""
        return value.isdigit() and len(value) == length and value == value.zfill(length)

