class SAMAdministrator:
    def verify_sam_data(self, sam_id: str) -> Dict:
        """Verify SAM data completeness"""
        with engine.begin() as conn:
            result = conn.execute(
                text("SELECT * FROM sam_data WHERE sam_id = :id"),
                {"id": sam_id}
            ).fetchone()

        if not result:
            return {"complete": False, "missing_fields": "all"}

        missing = []
        for field in ['name', 'address', 'uei']:
            if not result.get(field):
                missing.append(field)

        return {
            "complete": len(missing) == 0,
            "missing_fields": missing if missing else None
        }

